        <p>Space Oddity es una aplicacin frontend desarrollada con JavaScript y configurada con Vite. Esta aplicacin obtiene imgenes y videos desde 1996 hasta la fecha actual de la API APOD (Astronomic Picture of the Day) de la NASA.</p>
